//safe.epcc.ed.ac.uk/atom\">\r\n\r\n	<!-- Chart -->\r\n	<par:ParameterDef label=\"Plot\" name=\"Plot\" type=\"Plot\" />\r\n	<par:ParameterDef label=\"Group\" name=\"Group\" type=\"Group\" optional=\"true\" />\r\n	\r\n	<!--  Period -->\r\n	<par:ParameterDef label=\"Start Date\" name=\"StartDate\" type=\"Date\" value=\"Now-1m\"/>\r\n	<par:ParameterDef label=\"End Date\" name=\"EndDate\" type=\"Date\" value=\"Now-0m\"/>\r\n	<par:ParameterDef label=\"Number of Time Blocks\" name=\"NumberOfSplits\" type=\"Integer\" value=\"5\"/>\r\n	\r\n	<!-- Selection -->\r\n	<par:ParameterDef label=\"Machine\" name=\"Machine\" type=\"Machine\" optional=\"true\" />\r\n	<par:ParameterDef label=\"Project\" name=\"Project\" type=\"Project\" optional=\"true\" />\r\n	<par:ParameterDef label=\"User\" name=\"Person\" type=\"Person\" optional=\"true\" />\r\n\r\n	<sel:Filter>\r\n		<sel:Match>\r\n			<sel:Property>MachineName</sel:Property>\r\n			<sel:Value><par:Parameter name=\"Machine\"/></sel:Value>\r\n		</sel:Match>	\r\n	</sel:Filter>\r\n	<sel:Filter>\r\n		<sel:Match>\r\n			<sel:Property>Project</sel:Property>\r\n			<sel:Value><par:Parameter name=\"Project\"/></sel:Value>\r\n		</sel:Match>\r\n	</sel:Filter>\r\n	<sel:Filter>\r\n		<sel:Match>\r\n			<sel:Property>UserName</sel:Property>\r\n			<sel:Value><par:Parameter name=\"Person\" format=\"WebName\"/></sel:Value>\r\n		</sel:Match>		\r\n	</sel:Filter>\r\n	\r\n	<per:Period>\r\n		<per:StartTime><par:Parameter name=\"StartDate\"/></per:StartTime>\r\n		<per:EndTime><par:Parameter name=\"EndDate\"/></per:EndTime>\r\n		<per:NumberOfSplits><par:Parameter name=\"NumberOfSplits\"/></per:NumberOfSplits>\r\n	</per:Period>\r\n\r\n	<plo:TimeChart>\r\n		<plo:Plot><par:Parameter name=\"Plot\"/></plo:Plot>\r\n		<plo:Group><par:Parameter name=\"Group\"/></plo:Group>\r\n	</plo:TimeChart>\r\n\r\n</rep:Report>'),('eddie2',100,'report-templates','PieTimeChart.xml',NULL),('eddie2',101,'report-templates','ProjectJobs.xml',NULL),('eddie2',102,'report-templates','Test.